function ProgressBar(info) {
    var stem = {}; // 此函数最后返回的代表进度条的对象。
    var done = 0,
    length, outline, bar; // 声明内部变量。
    bar = document.getElementById('done'); // 进度条中绿色的变化部分。
    length = 50400;

    function reset() {
        return to(0);
    }
    // 设置进度到某个值。
    function to(value) {
        if (value >= 50400) {
            done = 50400;
            bar.setAttribute('width', length);
        } else {
            done = value;
            bar.setAttribute('width', Math.round(done * length / 50400));
        }
        return stem;
    }
    // 进度变化某个值。
    function advance(step) {
        return to(done + step);
    }
    // 以下给进度条对象添加方法。
    // 获得当前进度值。
    stem.getDone = function() {
        return done
    };
    stem.reset = reset;
    stem.to = to;
    stem.advance = advance;
    return stem; // 返回可供脚本使用的进度条对象。
}
